window.bookSummaryJSON = "<p>She ran from the mafia prince.</p> <p>But he won’t stop until she’s his wife.</p> <p>I’m Luca De Vos.</p> <p>Heir to one of the most powerful mafia empires in the Netherlands.</p> <p>Notorious mobster with a wicked taste for girls.</p> <p>But there’s only one woman I truly wanted.</p> <p>Jill Baas, mafia princess and the only woman who doesn’t want me.</p> <p>She did the unforgivable and then ran away.</p> <p>Now I’ll marry her sister.</p> <p>Until Jill storms right back into my arms on our wedding day…</p> <p>Begging me to marry her instead.</p> <p>It’s a dream come true for a depraved s*nner like me.</p> <p>Jill Baas—the runaway bride—mine to mark, own, taint.</p> <p>My wife.</p> <p>I’ll put my ring on her finger…</p> <p>And turn her world into a living nightmare.</p> <p>The Marriage Debt is a jaw-dropping dark mafia romance and can be listened to as a standalone.</p> <p>WARNING: This book includes scenes that may be disturbing to some listeners.</p>"; 
